"    try {

        if(window.EITRI){
            window.EITRI.navigation.back()
        } else {
            const eitriBridgeIos = window.webkit?.messageHandlers?.eitriBridge;
            if (eitriBridgeIos) {
                eitriBridgeIos.postMessage(JSON.stringify( { "methodName": "close"} ));
            }
        }
    } catch(e) {
        console.debug('Error Eitri.navigation.back()');
        console.debug(e.message);
    }"
